llm_output:
function checkTotalSupplyConstraint() public view {
    uint256 guaranteedSupply = guaranteedWhitelistSupply;
    uint256 competitiveSupply = competitiveWhitelistInfo;

    // Revert with Panic(0x11) if the condition is not met
    if (!(guaranteedSupply > ~competitiveSupply)) {
        assembly {
            mstore(0x00, 0x4e487b71) // keccak256("Panic(uint256)") selector
            mstore(0x04, 0x11)       // Panic code 0x11 (arithmetic overflow/underflow)
            revert(0x00, 0x24)
        }
    }
}
